import axios from "axios";
import {
  GET_ERRORS,
  GET_MESSAGE,
  SET_CURRENT_USER,
  USER_LOADING,
} from "./types";

// Get Tenants
export const getTenants = (onDataReceived) => (dispatch) => {
  axios
    .get("/api/tenants")
    .then((response) => {
      // console.log("response is:", response.data[0].staffkey);
      onDataReceived(response.data);
    })
    .catch((err) =>
      dispatch({
        type: GET_ERRORS,
        payload: err.response.data,
      })
    );
};
